import { makeStyles } from "@material-ui/core";

export const useStyles = makeStyles((theme) => ({
    root: {
        borderBottom: '1px solid var(--border)',
        color: 'white',
        padding: '10px'
    },
    title: {
        flexGrow: 1,
        textTransform: 'uppercase',
        fontSize: '30px',
        ...theme.typography.antonio,
    },
    link: {
        ...theme.link.paddingLink,
    }
}));
